import React from 'react';
import { useParams } from 'react-router-dom'; // To capture the product ID from the URL

const ProductDetail = () => {
  const { productId } = useParams(); // Capture the product ID from the URL

  // You can fetch product data based on the ID (productId)
  return (
    <div className="product-detail">
      <div className="image-gallery">
        <img src="a1.png" alt="Evil Eye Bracelet" />
      </div>
      <div className="product-info">
        <h1>Silver Black Elegant Anklet</h1>
        <p>Price: ₹4,399 <span className="original-price">₹8,599</span></p>
        <p><strong>Made With Pure 925 Silver</strong></p>
        <p>Hurry Up! Only 3 items left in stock</p>
        <button>Add to Cart</button>
        <button>Buy Now</button>
      </div>
    </div>
  );
}

export default ProductDetail;
